pragma solidity >0.4.0 <0.9.0;
pragma experimental ABIEncoderV2;

contract demo2 {
    function getData(string memory _in) public view returns(uint){
        return sizeOfString(_in);
    }
    // value is string and convert strinf to uint -< and return data type of value
    function sizeOfString(string memory _in) internal pure  returns(uint _size) {
        _size = bytes(_in).length / 32;
         if (bytes(_in).length % 32 != 0)
            _size++;
            
        _size++; // first 32 bytes is reserved for the size of the string     
        _size *= 32;
    }

    
    function sizeOfInt(uint16 _postfix) internal pure  returns(uint size) {
        assembly{
            switch _postfix
                case 8 { size := 1 }
                case 16 { size := 2 }
                case 24 { size := 3 }
                case 32 { size := 4 }
                case 40 { size := 5 }
                case 48 { size := 6 }
